import "./App.css";
import Weather from "./Weather";
import { library } from "@fortawesome/fontawesome-svg-core";
import {
  faLocationArrow,
  faPowerOff,
  faSearch,
  faLongArrowAltUp,
  faLongArrowAltDown,
} from "@fortawesome/free-solid-svg-icons";

library.add(
  faLocationArrow,
  faPowerOff,
  faSearch,
  faLongArrowAltUp,
  faLongArrowAltDown
);

export default function App() {
  return (
    <div className='App container-fluid pt-5 pb-5'>
      <Weather city='Paris' />
    </div>
  );
}
